void PPort_MVP2OCP::Start()
{
    m_logger.LogVerbose() << "PPort_MVP2OCP::Start";
    
    // construct skeleton
    ara::core::InstanceSpecifier specifier{"Exe_motionvelocityplanner/AA/PPort_MVP2OCP"};
    m_interface = std::make_unique<oss::srv::MVP2OCP::skeleton::OCP_SI_motionvelocityplannerSkeletonImpl>(specifier);
    
    // offer service
    auto offer = m_interface->OfferService();
    if (offer.HasValue())
    {
        m_running = true;
        m_logger.LogVerbose() << "PPort_MVP2OCP::Start::OfferService";
    }
    else
    {
        m_running = false;
        m_logger.LogError() << "PPort_MVP2OCP::Start::OfferService::" << offer.Error().Message();
    }
}
 
void PPort_MVP2OCP::Terminate()
{
    m_logger.LogVerbose() << "PPort_MVP2OCP::Terminate";
    
    // stop port
    m_running = false;
    
    // stop offer service
    m_interface->StopOfferService();
    m_logger.LogVerbose() << "PPort_MVP2OCP::Terminate::StopOfferService";
}
 
